script: |
  super -f text -I q6115.spq | sort > q6115.out

inputs:
  - name: q6115.spq
    data: |
      SELECT - col1 * - col1 + col0 AS col0, col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + col0 * 74 IN ( + col1, 58 + - - col2 );
  - name: tab0

outputs:
  - name: q6115.out
    data: |
      528	21
      6576	81
      98	1
